import React from 'react';
import styles from './Popper.module.scss';

const Popper = () => {
  return (
    <div className={`${styles.popper}`}>
      <span>Любой</span>
      <span>Вьетнам</span>
      <span>Китай</span>
      <span>Россия</span>
      <span>США</span>
    </div>
  );
};

export default Popper;
